The '''dunce''' is an [[imp]] which appears to bring you to the [[Surprise Exam]] [[random event]], and also appears walking in a circle on a stool, wearing a dunce cap.

During the [[2018 Birthday event]], he is to be dyed green in order to illustrate [[Eski]] for [[Da Vinci]]'s painting.

